import React from 'react'

class LogInForm extends React.Component {

   render(){
      return (
         <div className="login-container">
            <form className="login-form">
               <label>
                  Username:
                  <input type="textarea"/>
               </label>
               <label>
                  Password: 
                  <input type="textarea"/>
               </label>
            </form>
         </div>
      )
   }
}

export default LogInForm
